Our exchange participants' videos are that important since they can always encourage whenever we got tired of doing AIESEC things :) The thing that drives us the most to do AIESEC thing is when we know what we do is meaningful, especially  when someones enjoying what we give, which is volunteering and exchange experience abroad.

This is really what we say as "fulfillment of humankind potential". When we are improving, we are also upgrading our capability to improve others as well. People are our souce of energy, and also inspiration. Check the link in my bio for full video!

